import React, { Component } from 'react';
import { Card, Container, Form, Button, Row, Col, Table } from 'react-bootstrap';
import { withRouter } from "react-router-dom";
import axios from 'axios';

class ListPackages extends Component{
    constructor(props){
        super(props);
        this.state = {
            ListPackages: [],
            fields: {userName:''},
        }
    }

    componentDidMount(){
        axios.post(`http://localhost:8082/api/v1/carriers/listpackages?carrierCode=stamps_com`, '').then(res => {
            if(res && res.data && res.data.success) {
                this.setState({ListPackages: res.data.output});
            }
      })
    }
 
    render(){
        return(
            <Container fluid>
                <Card>
                    <Card.Body>
                     <Col md={4}>
                            <Form.Group className="mb-3">
                                <Form.Label>Username</Form.Label>
                                <Form.Control type="text" placeholder="Enter username" id="userName" name="userName" value={this.state.fields.userName} onChange={(e) => { this.handleOnChange(e) }} required />
                                <Form.Control.Feedback type="invalid">
                                    Please enter a username.
                                </Form.Control.Feedback>
                            </Form.Group>
                        </Col>

                        <Card.Title>List Packages</Card.Title>
                        <Row>
                            <Table striped hover size="sm">
                                <thead>
                                    <tr>
                                        <th><b>carrierCode</b></th>
                                        <th><b>code</b></th>
                                        <th><b>name</b></th>
                                        <th><b>domestic</b></th>
                                        <th><b>international</b></th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {this.state.ListPackages.map((prop) => {
                                        return <tr>
                                            <td>{prop["carrierCode"]}</td>
                                            <td>{prop["code"]}</td>
                                            <td>{prop["name"]}</td>
                                            <td>{prop["domestic"]}</td>
                                            <td>{prop["international"]}</td>
                                        </tr>
                                    })}
                                </tbody>
                            </Table>      
                        </Row>
                    </Card.Body>
                </Card>
            </Container>
        )
    }
}

export default ListPackages;
